INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 7, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", -363.0, 1, 7001, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 7, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", -363.0, 1, 7002, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 7, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", -363.0, 1, 7003, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 10, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", -363.0, 1, 10001, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 10, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", -363.0, 1, 10002, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 10, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", -363.0, 1, 10003, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 10, 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", -363.0, 1, 10004, "2030/12/17 14:59:59", 0.0, 2, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 12, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", -416.5, 1, 12001, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 13, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", -363.0, 1, 13001, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 13, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", -363.0, 1, 13002, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 13, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", -363.0, 1, 13003, "2030/12/17 14:59:59", 0.0, 2, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 13, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", -363.0, 1, 13004, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 14, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", -363.0, 1, 14001, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 14, 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", -363.0, 1, 14002, "2030/12/17 14:59:59", 0.0, 2, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 14, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", -363.0, 1, 14003, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 14, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", -363.0, 1, 14004, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 15, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", -470.0, 1, 15001, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 16, 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", -363.0, 1, 16001, "2030/12/17 14:59:59", 0.0, 2, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 16, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", -363.0, 1, 16002, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 16, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", -363.0, 1, 16003, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 16, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", -363.0, 1, 16004, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 17, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", -363.0, 1, 17002, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 25, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", -363.0, 1, 17004, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 25, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", -363.0, 1, 17005, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 25, 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", -363.0, 1, 17006, "2030/12/17 14:59:59", 0.0, 2, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 25, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", -363.0, 1, 17007, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 18, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", -363.0, 1, 18001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 18, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", -363.0, 2, 18002, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 19, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", -470.0, 3, 19001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 19, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", -470.0, 4, 19002, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 20, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", -470.0, 5, 20001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 20, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", -470.0, 6, 20002, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 21, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", -363.0, 1, 21001, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 21, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", -363.0, 1, 21002, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 21, 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", -363.0, 1, 21003, "2030/12/17 14:59:59", 0.0, 2, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 21, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", -363.0, 1, 21004, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 22, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", -430.0, 1, 22001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 22, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", -430.0, 2, 22002, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 23, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", -430.0, 3, 23001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 23, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", -430.0, 4, 23002, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 4.08, 24, 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", -385.0, 1, 24001, "2030/12/17 14:59:59", 8.0, 1, 109001, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 5.0, 24, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", -385.0, 2, 24002, "2030/12/17 14:59:59", 8.0, 1, 109001, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 10.11, 24, 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", -385.0, 3, 24003, "2030/12/17 14:59:59", 8.0, 1, 109001, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 4.0, 24, 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", -385.0, 4, 24004, "2030/12/17 14:59:59", 8.0, 1, 109001, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 6.0, 24, 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", -385.0, 5, 24005, "2030/12/17 14:59:59", 8.0, 1, 109001, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 6, 24006, "2030/12/17 14:59:59", 0.0, 1, 109002, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 7, 24007, "2030/12/17 14:59:59", 0.0, 1, 109002, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 8, 24008, "2030/12/17 14:59:59", 0.0, 1, 109002, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 9, 24009, "2030/12/17 14:59:59", 0.0, 1, 109002, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 10, 24010, "2030/12/17 14:59:59", 0.0, 1, 109002, "エリコ（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 2.12, 24, 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", -385.0, 1, 24011, "2030/12/17 14:59:59", 8.0, 1, 109101, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 4.19, 24, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", -385.0, 2, 24012, "2030/12/17 14:59:59", 8.0, 5, 109101, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 2.3, 24, 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", -385.0, 3, 24013, "2030/12/17 14:59:59", 8.0, 2, 109101, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 4, 24014, "2030/12/17 14:59:59", 0.0, 1, 109102, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 5.23, 24, 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", -385.0, 5, 24015, "2030/12/17 14:59:59", 8.0, 5, 109101, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 6, 24016, "2030/12/17 14:59:59", 0.0, 1, 109102, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 5.01, 24, 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", -385.0, 7, 24017, "2030/12/17 14:59:59", 8.0, 1, 109101, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 8, 24018, "2030/12/17 14:59:59", 0.0, 1, 109102, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 9, 24019, "2030/12/17 14:59:59", 0.0, 1, 109102, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 24, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 10, 24020, "2030/12/17 14:59:59", 0.0, 1, 109102, "シズル（バレンタイン）", "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 26, 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", -363.0, 1, 26001, "2030/12/17 14:59:59", 0.0, 2, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 26, 1, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", -363.0, 1, 26002, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 26, 1, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", -363.0, 1, 26003, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 26, 1, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", -363.0, 1, 26004, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 27, 1, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", -363.0, 1, 27001, "2030/12/17 14:59:59", 0.0, 2, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 27, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", -363.0, 1, 27002, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 27, 1, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", -363.0, 1, 27003, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 27, 1, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", -363.0, 1, 27004, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 28, 1, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", -363.0, 1, 28001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2019/09/24 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 28, 1, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", -363.0, 2, 28002, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2019/09/24 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 29, 1, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", -409.0, 3, 29001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2019/09/24 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 29, 1, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", -409.0, 4, 29002, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2019/09/24 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 30, 1, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", -409.0, 5, 30001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2019/09/24 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 30, 1, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", -409.0, 6, 30002, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2019/09/24 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 31, 1, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", -409.0, 7, 31001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2019/10/31 12:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 31, 1, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", -409.0, 8, 31002, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2019/10/31 12:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 32, 1, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", -409.0, 1, 32001, "2020/01/04 4:59:59", 0.0, 1, 190801, "カリン", "2019/12/20 5:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 32, 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 2, 32002, "2020/01/04 4:59:59", 0.0, 1, 190801, "カリン", "2019/12/20 5:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 33, 1, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", -409.0, 3, 33001, "2020/01/04 4:59:59", 0.0, 1, 190801, "カリン", "2019/12/20 5:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 33, 1, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 4, 33002, "2020/01/04 4:59:59", 0.0, 1, 190801, "カリン", "2019/12/20 5:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 34, 1, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", -409.0, 5, 34001, "2020/01/10 11:59:59", 0.0, 1, 190801, "カリン", "2020/01/04 5:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 34, 1, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", -409.0, 6, 34002, "2020/01/10 11:59:59", 0.0, 1, 190801, "カリン", "2020/01/04 5:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 5.3, 38, 2, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", -458.0, 1, 38001, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 6.5, 38, 2, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", -458.0, 2, 38002, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 39, 3, "", 9999.0, 0, 39005, "2020/04/08 23:59:59", 9999.0, 3, 105801, "ペコリーヌ", "2020/04/01", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 40, 1, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", -430.0, 2, 40001, "2030/12/17 14:59:59", 0.0, 1, 190801, "カリン", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 41, 1, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", -363.0, 1, 41001, "2030/12/17 14:59:59", 0.0, 1, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 41, 1, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", -363.0, 1, 41002, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 41, 1, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", -363.0, 1, 41003, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 41, 1, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", -363.0, 1, 41004, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 42, 1, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", -416.5, 1, 42001, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (2104010, 0.0, 42, 1, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", -416.5, 1, 42002, "2030/12/17 14:59:59", 0.0, 1, 106401, "シェフィ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 42, 1, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", -416.5, 1, 42003, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 42, 1, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", -416.5, 1, 42004, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 43, 1, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", -363.0, 1, 43001, "2030/12/17 14:59:59", 0.0, 1, 105801, "ペコリーヌ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 43, 1, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", -363.0, 1, 43002, "2030/12/17 14:59:59", 0.0, 1, 105901, "コッコロ", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 43, 1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", -363.0, 1, 43003, "2030/12/17 14:59:59", 0.0, 1, 106001, "キャル", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 44, 1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", -416.5, 1, 43004, "2030/12/17 14:59:59", 0.0, 1, 123001, "アメス", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 44, 1, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", -416.5, 2, 43005, "2030/12/17 14:59:59", 0.0, 1, 123001, "アメス", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 5.79, 45, 2, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", -416.5, 3, 43006, "2030/12/17 14:59:59", 0.0, 1, 123001, "アメス", "2015/12/17 15:00:00", 0);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (0, 0.0, 46, 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", -371.5, 1, 46001, "2030/12/17 14:59:59", 0.0, 1, 123001, "アメス", "2015/12/17 15:00:00", 0);
